import { useEffect, useState } from "react";
import "./App.css";
import axios from "axios";

function App() {
  const [openChatList, setOpenChatList] = useState([]);

  useEffect(() => {
    async function fetchOpenChatList() {
      const res = await axios.get("http://localhost:5000/getLinks", {
        headers: { "Access-Control-Allow-Origin": "*" },
      });

      console.log(res.data.result.list);

      setOpenChatList(res.data.result.list);
    }
    // effect
    fetchOpenChatList();
    return () => {
      // cleanup
    };
  }, []);

  function renderOpenChatList() {
    openChatList.map((chat) => {
      return <div>{chat.name}</div>;
    });
  }

  return (
    <div className="App">
      <h1>Open Chat Lists</h1>
      {renderOpenChatList()}
    </div>
  );
}

export default App;
